import BookList from './book-list';
import BookDetails from './book-list';

export default function(){

    return (
        <>
            <div className="col-xs-12 col-sm-12 col-md-6 col-lg-6 left-section">
                <BookList/>
            </div>
            <div className="col-xs-12 col-sm-12 col-md-6 col-lg-6 left-section">
                <BookDetails/>
            </div>
        
        </>
    );
}
